from model import *
from utils import *

def check_range(data):
    max_x = len(data[0])
    max_y = len(data)
    return max_x, max_y

def make_map(data):
    map = Map()
    walls = []
    boxes = []
    x_max, y_max = check_range(data)
    for i in range(len(data)):
        for n in range(len(data[i])):
            if data[i][n] == ["#"]:
                wall = Wall(Coordinate(n, i,  x_max, y_max))
                walls.append(wall)
            elif data[i][n] == ['O']:
                box = Box(Coordinate(n, i, x_max, y_max))
                boxes.append(box)
            elif data[i][n] == ["@"]:
                map.robot = Robot(Coordinate(n, i, x_max, y_max))
    map.wall = walls
    map.box = boxes
    #nice_print(map.wall,"wall")
    #nice_print(map.box, "box")
    #print(map.robot, "robot")
    return map


def visualise(data, map):
    max_x, max_y = check_range(data)
    grid = [[[' '] for _ in range(max_y)] for _ in range(max_x)]
    walls = map.wall
    boxes = map.box
    robot = map.robot
    for wall in walls:
        grid[wall.get_position().get_y()][wall.get_position().get_x()] = ['#']
    for box in boxes:
        grid[box.get_position().get_y()][box.get_position().get_x()] = ['O']
    grid[robot.get_position().get_y()][robot.get_position().get_x()] = ['@']
    nice_print(grid, "")
    return(grid)


def check_boxes(map, x, y, grid, move, case):
    i = 0
    directions = {
        '>': (1, 0),
        '<': (-1, 0),
        'v': (0, 1),
        '^': (0, -1)
    }
    dx, dy = directions[move]
    print(f"Initial position: ({x}, {y}), move: {move}, case: {case}")
    
    while True:
        check_x = x + dx * (i + 1)
        check_y = y + dy * (i + 1)
        print(f"Checking position: ({check_x}, {check_y}), iteration: {i}")
        
        if not check_box_position(map, check_x, check_y, grid, move, case):
            print(f"Break condition met at position: ({check_x}, {check_y})")
            break
        i += 1
    
    final_x = x + dx * (i + 1)
    final_y = y + dy * (i + 1)
    print(f"Final position to check: ({final_x}, {final_y})")
    
    result = check_box_position(map, final_x, final_y, grid, move, [' '])
    print(f"Result of final check_box_position: {result}")
    
    if result != False:
        final_position = (final_x + dx, final_y + dy)
        print(f"Returning final position: {final_position}")
        return final_position
    else:
        print("Returning False")
        return False

def swap_box(grid,box,x, y):
    x_max = len(grid[0])
    y_max = len(grid)
    box.set_position(Coordinate(x, y, x_max, y_max ))


def single_move(map, move, grid):
    robot_position_x, robot_position_y = map.robot.get_position().get_x(), map.robot.get_position().get_y()
    if check_box_position(map, robot_position_x,  robot_position_y,  grid, move,['O']) != False:
        x, y = check_box_position(map, robot_position_x, robot_position_y, grid, move, ['O'])
        box = map.is_box(x, y)
        if check_box_position(map, x, y, grid, move, ['O']) != False:
            print("checking here")
            if check_boxes(max, x, y, grid, move, ['O']) != False:
                print("checking boxes")
                b_x, b_y = check_boxes(max, x, y, grid, move, ['O'])
                swap_box(grid, box, b_x, b_y)
                map.robot.step(move)
            else:
                box.step(['-'])
        elif check_box_position(map, x, y, grid, move, ['#']) != False:
            box.step(['-'])
        elif check_box_position(map, x, y, grid, move, [' ']) != False:
            box.step(move)
            map.robot.step(move)
    else:
        if check_box_position(map, robot_position_x, robot_position_y, grid, move, ['#']) != False:
            map.robot.step(['-'])
        else:
            map.robot.step(move)
    grid = visualise(grid, map)
    return grid
        
